import React from "react";
import { NavLink } from "react-router-dom";
import "./NavBar.css"

function NavBar({ dogs }) {
    return (
        <nav className="NavBar">
            <ul>
                <li>
                    <NavLink exact to="/dogs">Home</NavLink>
                </li>
                { dogs.map((dog, index) => (
                    <li key={ index }>
                        <NavLink to={ `/dogs/${dog.name}` }>{ dog.name }</NavLink>
                    </li>
                )) }
            </ul>
        </nav>
    );
};

export default NavBar;
